                        "description": "Indicates in which attributes to sort. Host is only used for admin role users",
                        "required": false,
                        "schema": {
                            "type": "array",
                            "items": {
                                "$ref": "#/components/schemas/ServerSortKey"
                            },
                            "description": "Indicates in which attributes to sort. Host is only used for admin role users"
