                    {
                        "description": "List servers for all projects.",
                        "required": false,
                        "schema": {
                            "title": "All Projects",
                            "type": "boolean",
                            "description": "List servers for all projects."
                        },
                        "name": "all_projects",
                        "in": "query"
                    },
                    {
                        "description": "Filter the list of servers by the given project ID. Only works when the all_projects filter is also specified.",
